(function() {
  $(document).ajaxError(function(event, request) {
    if (request.readyState === 0) {
      return toastr.error(I18n.t("ajax.error_network"), I18n.t("ajax.error_title"));
    } else {
      return toastr.error(I18n.t("ajax.error_message"), I18n.t("ajax.error_title"));
    }
  });

}).call(this);
(function() {
  App.roadmapInitialize = function() {
    App.checkBoxesLocalStorage();
    App.noInteresaCheckBox();
    App.updateNoInteresaCheckbox();
    App.updateCommentObjetivo();
    return App.updateEffort();
  };

}).call(this);
(function() {
  jQuery(function() {
    return App.sort = function() {
      return $('#sortable').sortable({
        axis: 'y',
        items: '.item',
        handle: ".handle",
        stop: function(e, ui) {
          return ui.item.children('td').effect('highlight', {}, 1000);
        },
        update: function(e, ui) {
          var item_id, position;
          item_id = ui.item.data('item-id');
          position = ui.item.index();
          return $.ajax({
            type: 'POST',
            url: $(this).data('update-url'),
            dataType: 'json',
            data: {
              id: item_id,
              user_practica: {
                row_order_position: position
              }
            }
          });
        }
      });
    };
  });

}).call(this);
(function() {
  jQuery(function() {
    return App.sort_objetivo = function() {
      return $('#tabla_objetivos').sortable({
        axis: 'y',
        items: '.item-objetivo',
        handle: ".handle",
        stop: function(e, ui) {
          return ui.item.children('td').effect('highlight', {}, 1000);
        },
        update: function(e, ui) {
          var item_id, position;
          item_id = ui.item.data('item-id');
          position = ui.item.index();
          return $.ajax({
            type: 'POST',
            url: $(this).data('update-url'),
            dataType: 'json',
            data: {
              id: item_id,
              user_objetivo: {
                row_order_position: position
              }
            }
          });
        }
      });
    };
  });

}).call(this);
(function() {
  var cbLocalStorage;

  App.checkBoxesLocalStorage = function() {
    cbLocalStorage('checkbox-margen', '#no_margen', '.no-margen');
    cbLocalStorage('checkbox-aplicable', '#no_aplicable', '.no-aplicable');
    return cbLocalStorage('checkbox-interesa', '#no_interesa', '.no-interesa');
  };

  cbLocalStorage = function(itemStorage, idCheckBox, classRows) {
    var cbChecked;
    cbChecked = localStorage.getItem(itemStorage);
    if (cbChecked === 'true') {
      cbChecked = true;
    } else {
      cbChecked = false;
    }
    $(idCheckBox).prop('checked', cbChecked);
    if (cbChecked) {
      $(classRows).hide();
    }
    return $(idCheckBox).change(function() {
      if (this.checked) {
        return localStorage.setItem(itemStorage, true);
      } else {
        return localStorage.setItem(itemStorage, false);
      }
    });
  };

}).call(this);
(function() {
  App.updateCommentObjetivo = function() {
    return $(".objetivo-comment").blur(function() {
      var $this, comment_new, item_id;
      $this = $(this);
      item_id = $this.parent().parent().data('item-id');
      comment_new = $this.val();
      return $.ajax({
        type: 'POST',
        url: $('table#tabla_objetivos').data('update-rest'),
        dataType: 'json',
        data: {
          id: item_id,
          user_objetivo: {
            comment: comment_new
          }
        }
      });
    });
  };

  App.updateNoInteresaCheckbox = function() {
    return $(".no-interesa-checkbox").change(function() {
      var $this, fila_objetivo, objetivo_id;
      $this = $(this);
      fila_objetivo = $this.parent().parent();
      objetivo_id = fila_objetivo.data('item-id');
      if (this.checked && $('#no_interesa').is(':checked')) {
        fila_objetivo.fadeOut("slow", function() {
          return fila_objetivo.addClass("no-interesa");
        });
      } else if (this.checked) {
        fila_objetivo.addClass("no-interesa");
      } else {
        fila_objetivo.removeClass("no-interesa");
      }
      return $.ajax({
        type: 'POST',
        url: $('table#tabla_objetivos').data('interesa-url'),
        dataType: 'json',
        data: {
          id: objetivo_id,
          user_objetivo: {
            no_interesa: this.checked
          }
        }
      });
    });
  };

  App.noInteresaCheckBox = function() {
    return $("#no_interesa").change(function() {
      if (this.checked) {
        return $(".no-interesa").fadeOut("slow");
      } else {
        return $(".no-interesa").fadeIn("slow");
      }
    });
  };

}).call(this);
(function() {
  jQuery(function() {
    App.autosizeTextArea = function() {
      return $('textarea.comment').autosize();
    };
    App.toggleTablaObjetivos = function() {
      return $('#toggle_objetivos').click(function() {
        $('#checkbox_objetivo').toggle('slow');
        $('#tabla_objetivos').toggle('slow');
        App.resetFilasTablaPracs();
        $('#toggle_objetivos i').toggle();
        $('.objetivo-eye-close').hide();
        $('.objetivo-eye-open').show();
        return $('#tabla_objetivos tr.active').removeClass('active');
      });
    };
    App.noMargenCheckBox = function() {
      return $("#no_margen").change(function() {
        if (this.checked) {
          return $(".no-margen").fadeOut("slow");
        } else {
          return $(".no-margen").fadeIn("slow");
        }
      });
    };
    App.noAplicableCheckBox = function() {
      return $("#no_aplicable").change(function() {
        if (this.checked) {
          return $(".no-aplicable").fadeOut("slow");
        } else {
          return $(".no-aplicable").fadeIn("slow");
        }
      });
    };
    App.updateAplicableCheckBox = function() {
      return $(".no-aplicable-checkbox").change(function() {
        var $this, fila_practica, item_id;
        $this = $(this);
        fila_practica = $this.parent().parent();
        item_id = fila_practica.data('item-id');
        if (this.checked && $('#no_aplicable').is(':checked')) {
          fila_practica.fadeOut("slow", function() {
            return fila_practica.addClass("no-aplicable");
          });
        } else if (this.checked) {
          fila_practica.addClass("no-aplicable");
        } else {
          fila_practica.removeClass("no-aplicable");
        }
        return $.ajax({
          type: 'POST',
          url: $('table#sortable').data('aplicable-url'),
          dataType: 'json',
          data: {
            id: item_id,
            user_practica: {
              no_aplicable: this.checked
            }
          }
        });
      });
    };
    App.updateRange = function() {
      return $(".range").change(function() {
        var $this, fila_practica, item_id, range_new;
        $this = $(this);
        fila_practica = $this.parent().parent();
        item_id = fila_practica.data('item-id');
        range_new = $this.val();
        if (range_new >= 0) {
          $this.removeClass("amarillo");
        } else {
          $this.addClass("amarillo");
        }
        if (range_new === "4" && $('#no_margen').is(':checked')) {
          fila_practica.fadeOut("slow", function() {
            return fila_practica.addClass("no-margen");
          });
        } else if (range_new === "4") {
          fila_practica.addClass("no-margen");
        } else {
          fila_practica.removeClass("no-margen");
        }
        return $.ajax({
          type: 'POST',
          url: $('table#sortable').data('range-url'),
          dataType: 'json',
          data: {
            id: item_id,
            user_practica: {
              range: range_new
            }
          }
        });
      });
    };
    App.updateEffort = function() {
      return $(".effort").change(function() {
        var $this, effort_new, fila_practica, item_id;
        $this = $(this);
        fila_practica = $this.parent().parent();
        item_id = fila_practica.data('item-id');
        effort_new = $this.val();
        return $.ajax({
          type: 'POST',
          url: $('table#sortable').data('update-rest'),
          dataType: 'json',
          data: {
            id: item_id,
            user_practica: {
              effort: effort_new
            }
          }
        });
      });
    };
    App.updateComment = function() {
      return $(".comment").blur(function() {
        var $this, comment_new, item_id;
        $this = $(this);
        item_id = $this.parent().parent().data('item-id');
        comment_new = $this.val();
        return $.ajax({
          type: 'POST',
          url: $('table#sortable').data('comment-url'),
          dataType: 'json',
          data: {
            id: item_id,
            user_practica: {
              comment: comment_new
            }
          }
        });
      });
    };
    App.objetivoClick = function() {
      var valoresContribucion;
      valoresContribucion = {
        1: 'Muy Baja',
        2: 'Baja',
        3: 'Media',
        4: 'Alta',
        5: 'Muy Alta'
      };
      return $(".ver-practica").click(function() {
        var $this, i, id, ids, len;
        $this = $(this);
        ids = $this.parent().parent().data('ids');
        if ($this.find('.objetivo-eye-open').css('display') === 'none') {
          App.resetFilasTablaPracs();
          App.resetFilasRelPracs();
          App.resetTablaObjetivos();
          return;
        }
        App.resetFilasTablaPracs();
        App.resetFilasRelPracs();
        App.resetTablaObjetivos();
        $this.find('.objetivo-eye-close').toggle();
        $this.find('.objetivo-eye-open').toggle();
        $this.parent().parent().addClass('active');
        for (i = 0, len = ids.length; i < len; i++) {
          id = ids[i];
          $('tr[data-practica-id="' + id[0] + '"]').addClass("success");
          $('tr[data-practica-id="' + id[0] + '"]').append('<td class="contribucion">' + valoresContribucion[id[1]] + '</td');
        }
        $('table#sortable thead tr').append('<th class="col-sm-1 col-xs-1 valor-contribucion">Contribucin al objetivo</th>');
        return $("html, body").animate({
          scrollTop: $("#mapa").offset().top
        }, 2000);
      });
    };
    App.practicaClick = function() {
      return $(".ver-practicas-relacionadas").click(function(e) {
        var $this, i, id, ids, len;
        $this = $(this);
        ids = $this.parent().parent().data('pracs-ids');
        if ($this.find('.practica-eye-close').css('display') === 'none') {
          App.resetFilasRelPracs();
        }
        App.resetFilasTablaPracs();
        App.resetTablaObjetivos();
        $this.find('.practica-eye-close').toggle();
        $this.find('.practica-eye-open').toggle();
        if ($this.find('.practica-eye-close').css('display') === 'none') {
          $this.parent().parent().removeClass('active');
          $('.practica').removeClass('resaltado');
        } else {
          $this.parent().parent().addClass('active');
          for (i = 0, len = ids.length; i < len; i++) {
            id = ids[i];
            $('tr[data-practica-id="' + id + '"]').addClass("resaltado");
          }
        }
        return e.preventDefault();
      });
    };
    App.resetFilasTablaPracs = function() {
      $('.practica').removeClass("success");
      $('.contribucion').remove();
      return $('.valor-contribucion').remove();
    };
    App.resetFilasRelPracs = function() {
      $('.practica.active .practica-eye-close').hide();
      $('.practica.active .practica-eye-open').show();
      return $('.practica').removeClass("resaltado active");
    };
    return App.resetTablaObjetivos = function() {
      $('.objetivo.active .objetivo-eye-close').hide();
      $('.objetivo.active .objetivo-eye-open').show();
      return $('.objetivo').removeClass("active");
    };
  });

}).call(this);
(function() {
  $(document).ready(function() {
    App.init();
    App.initSliders();
    Index.initParallaxSlider();
    return $(document).off('page:done').on('page:done', function(event, $target, status, url, data) {
      App.init();
      App.initSliders();
      Index.initParallaxSlider();
      $('[data-hover="dropdown"]').dropdownHover();
      if ($('RAILS_ENV').text() === 'production') {
        return _gaq.push(['_trackPageview', url]);
      }
    });
  });

}).call(this);
